import './App.css';
import { useState } from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import Homepage from './Components/JSXcomponents/Homepage';
import NewCostumer from './Components/JSXcomponents/NewCostumer';
import CostumerData from './Components/JSXcomponents/CostumerData';

function App() {

  const [costumers, setCostumers] = useState([]);
  console.log(costumers);
  return (

    <div className="App">
      <BrowserRouter>
        <Routes>
          <Route path = {'/'} element = {<Homepage costumers = {costumers} />} />
          <Route path = {'/NewCostumer'} element = {<NewCostumer costumers = {costumers} setCostumers = {setCostumers} />} />
          <Route path = {'/CostumerData'} element = {<CostumerData costumers = {costumers}/>}/>
        </Routes>
      </BrowserRouter>
    </div>
  );
}

export default App;
